Here is a guideline for implementing a basic surveillance camera control system in C#. Keep in mind that the proper functioning of such a system usually requires specific hardware and libraries.

```c#
using System;
using System.Net;
using System.Net.Sockets;
using System.Text;

class SurveillanceCameraControl
{
    private string ipAddress;
    private int port;

    public SurveillanceCameraControl(string ipAddress, int port)
    {
        this.ipAddress = ipAddress;
        this.port = port;
    }

    public bool MoveCamera(string direction)
    {
        string commandText = $"MOVE-{direction}";

        try
        {
            TcpClient client = new TcpClient(ipAddress, port);
            byte[] data = Encoding.ASCII.GetBytes(commandText);
            NetworkStream stream = client.GetStream();
            stream.Write(data, 0, data.Length);

            byte[] receivedData = new byte[256];
            int bytesRead = stream.Read(receivedData, 0, receivedData.Length);
            string response = Encoding.ASCII.GetString(receivedData,  0, bytesRead);

            client.Close();
            return response.Trim().ToUpper() == "OK";
        }
        catch (Exception ex)
        {
            Console.WriteLine($"Error: {ex.Message}");
            return false;
        }
    }
}

class Program
{
    static void Main()
    {
        Console.WriteLine("Surveillance Camera Control");

        const string IP_ADDRESS = "192.168.0.100"; // Replace with the camera's IP address 
        const int PORT = 1234; // Replace with the appropriate camera control port number

        try
        {
            Console.Write("Select camera movement direction (up/down/left/right): ");
            string direction = Console.ReadLine();

            SurveillanceCameraControl cameraControl = new SurveillanceCameraControl(IP_ADDRESS, PORT);
            if (cameraControl.MoveCamera(direction))
            {
                Console.WriteLine("Command executed successfully!");
            }
            else
            {
                Console.WriteLine("There was an error executing the command.");
            }
        }
        catch (Exception ex)
        {
            Console.WriteLine($"Error: {ex.Message}");
        }
    }
}
```

Notes:
- Replace the `"192.168.0.100"` with the correct IP address of your surveillance camera.
- `PORT` variable refers to the camera control port. Verify which port you need to use for controlling your camera implementation.
