package main

import (
    "fmt"
    "log"
    "net"
    "sync"
)

func main() {
    target := "127.0.0.1" // IP address or hostname of the target
    // Use a WaitGroup to add concurrency
    var wg sync.WaitGroup

    for port := 1; port <= 65535; port++ {
        // Increment the WaitGroup counter
        wg.Add(1)

        // Launch a goroutine to scan the ports asynchronously
        go func(port int) {
            // On the goroutine exit, inform the WaitGroup
            defer wg.Done()

            address := fmt.Sprintf("%s:%d", target, port)
            conn, err := net.Dial("tcp", address)
            if err == nil {
                fmt.Printf("Open port: %d\n", port)
		    conn.Close()
	    	// Do any tasks that require  open port 
            }
        }(port)     
    }

    // Wait for all goroutines to complete
    wg.Wait()
}
